import { Form, Link } from "react-router-dom";
import { useState } from 'react';
import { useEffect } from 'react';
import React, { Component } from 'react'
import { TiDelete } from "react-icons/ti";
import { type } from "os";



const ClientInfo = ({handleDeleteData}) =>  (
    function ClientInfoData() {
        interface Post {
            name: string;
            phone_number: string;
            id: any | null;
        }
          
        const post: Post = {
            name: "",
            phone_number: "",
            id: ""
        };
    
        return (
            <div>
                {post.name}, {post.phone_number} 
                <TiDelete className='styleIcons' onClick={() => handleDeleteData(post.id)}>{post.id}</TiDelete>
            </div>
        );
    }
)



export default ClientInfo
